function add_wholesale_discount( $cart ) {
    if ( is_user_logged_in() && current_user_can( 'wholesale' ) ) {
        $discount = 0;
        // Iterate through each cart item
        foreach ( $cart->get_cart() as $cart_item ) {
            $product_id = $cart_item['product_id'];
            $product_cats = wp_get_post_terms( $product_id, 'product_cat', array( 'fields' => 'ids' ) );
            $product_tags = wp_get_post_terms( $product_id, 'product_tag', array( 'fields' => 'ids' ) );
            // Rule: Apply 30% discount for Greek, English, Romanian book tags
            if ( (in_array( '21', $product_tags ) || in_array( '23', $product_tags )) || in_array('25', $product_tags) ) {
                $discount += $cart_item['line_total'] * 0.30;
            }
        }
        // Add the discount
        $cart->add_fee( 'Wholesale Discount', -$discount );
    }
}

