// solution to https://atcoder.jp/contests/abc356/tasks/abc356_g
// Using line-polygon intersection O(log n)

#include <bits/stdc++.h>
#define int long long
using namespace std;

int det(int a, int b, int c, int d) {
    return a * d - b * c;
}

struct pt {
    int x, y;

    pt(int x, int y) : x(x), y(y) {}
    pt() : x(0), y(0) {}

    friend pt operator-(const pt &a, const pt &b) {
        return {a.x - b.x, a.y - b.y};
    }

    pt& operator-=(const pt& other) {
        x -= other.x;
        y -= other.y;
        return *this;
    }

    pt& operator+=(const pt& other) {
        x += other.x;
        y += other.y;
        return *this;
    }

    int norm2() const {
        return x * x + y * y;
    }
};

int cross(pt a, pt b) {
    return a.x * b.y - a.y * b.x;
}

int find_zero(int x0, int x1, const std::function<int(int)> &f) {
    int v0 = f(x0);
    if (v0 == 0)
        return x0 + 1;
    int left = x0, right = x1 + 1;
    while (left + 1 < right) {
        int mid = (left + right) / 2;
        if ((__int128)v0 * (__int128)f(mid) >= 0) left = mid;
        else right = mid;
    }
    return right;
}

int binary_search(const std::function<double(int)> &f, int L) {
    int left = 0, right = L;
    while (left + 1 < right) {
        int mid = (left + right) / 2;
        if (f(mid) < 0) left = mid;
        else right = mid;
    }
    return right;
}

pair<double, double> solve_system(int a11, int a12, int b1, int a21, int a22, int b2) {
    int d = det(a11, a12, a21, a22);
    int d1 = det(b1, a12, b2, a22);
    int d2 = det(a11, b1, a21, b2);
    return {(double)d1 / d, (double)d2 / d};
}

pair<double, double> intersect(pt a1, pt v1, pt a2, pt v2) {
    auto [t1, t2] = solve_system(v1.x, -v2.x, a2.x - a1.x, v1.y, -v2.y, a2.y - a1.y);
    return {a1.x + v1.x * t1, a1.y + v1.y * t1};
}

vector<int> line_polygon_intersection(pt p0, pt p1, vector<pt> &qs) {
    if (qs.size() == 2) {
        return {1};
    }
    auto h = [&](pt p) {
        return cross(p - p0, p1 - p0);
    };
    int L = qs.size();
    int i0 = -1, i1 = -1;
    int v0 = h(qs[0]);
    int v1 = h(qs[L - 1]);
    if (v0 == v1) {
        int v2 = h(qs[1]);
        assert(v0 != v2);
        if (v0 < v2) i0 = L - 1;
        else i1 = L - 1;
    } else {
        int v2 = h(qs[1]);
        if (v1 > v0 && v0 <= v2) i0 = 0;
        else if (v1 < v0 && v0 >= v2) i1 = 0;
        else {
            auto g = [&](int x) {
                return min((double)(v1 - v0) * x / (L - 1) + v0, (double)h(qs.at(x)));
            };
            i0 = binary_search([&](int x) {
                return g(x + 1) - g(x);
            }, L - 1);
        }
    }

    if (i1 == -1) {
        int B = i0 - L;
        int k = binary_search([&](int x) {
            return h(qs.at((B+x+L)%L)) - h(qs.at((B+x+1+L)%L));
        }, L);
        i1 = (i0 + k + L) % L;
    } else {
        int B = i1 - L;
        int k = binary_search([&](int x) {
            return  h(qs.at((B+x+1+L)%L)) - h(qs.at((B+x+L)%L));
        }, L);
        i0 = (i1 + k + L) % L;
    }

    if ((__int128)h(qs.at(i0)) * (__int128)h(qs.at(i1)) > 0)
        return {};

    auto f = [&](int i) {
        return h(qs.at((i + 10 * L) % L));
    };
    int k0 = (find_zero(i1, i1 < i0 ? i0 : i0 + L, f) + L) % L;
    int k1 = (find_zero(i0, i0 < i1 ? i1 : i1 + L, f) + L) % L;
    if (k0 == k1) return {k0};
    return {k0, k1};
}

vector<pt> convex_hull(vector<pt> poly) {
    pt p0 = poly[0];
    int idx = 0;
    for (int i = 1; i < poly.size(); ++i) {
        if (poly[i].y < p0.y || poly[i].y == p0.y && poly[i].x < p0.x) {
            idx = i;
            p0 = poly[i];
        }
    }
    poly.erase(poly.begin() + idx);
    for (auto& p : poly) {
        p -= p0;
    }
    sort(poly.begin(), poly.end(), [](pt a, pt b) {
        if (cross(a, b) == 0) {
            return a.norm2() < b.norm2();
        }
        return cross(a, b) > 0;
    });
    vector<pt> ans = {{0, 0}};
    for (int i = 0; i < poly.size(); ++i) {
        while (ans.size() >= 2 && cross(poly[i] - ans[ans.size() - 2], ans.back() - ans[ans.size() - 2]) >= 0) {
            ans.pop_back();
        }
        ans.push_back(poly[i]);
    }
    for (auto& p : ans) {
        p += p0;
    }
    return ans;
}

void solve(vector<pt> poly, const vector<pair<int, int>>& queries) {
//    int n; cin >> n;
//    vector<pt> poly(n);
//    for (int i = 0; i < n; ++i) {
//        cin >> poly[i].y >> poly[i].x;
//    }
    poly = convex_hull(poly);
    int n = poly.size();
    int alpha = min_element(poly.begin(), poly.end(), [](pt a, pt b) {
        return a.y * b.x < b.y * a.x;
    }) - poly.begin();
    int omega = max_element(poly.begin(), poly.end(), [](pt a, pt b) {
        return a.x < b.x;
    }) - poly.begin();
    for (auto& [c, d] : queries) {
        if (poly[alpha].y * d > c * poly[alpha].x) {
            cout << "-1\n";
            continue;
        }
        if (poly[omega].y * d <= c * poly[omega].x) {
            cout << fixed << (double)d / poly[omega].x << "\n";
            continue;
        }
        vector<int> inters = line_polygon_intersection({0, 0}, {d, c}, poly);
        if (inters.empty()) {
            assert(0);
            cout << "BAD" << endl;
            exit(0);
        }
        double res = 1e18;
        for (int i : inters) {
            auto [x, y] = intersect({0, 0}, {d, c}, poly[i], poly[(i - 1 + n) % n] - poly[i]);
            res = min(res, (double)d / x);
        }
        cout << fixed << res << "\n";
    }
}

int32_t main() {
    ios_base::sync_with_stdio(false);
    cin.tie(nullptr);
    cout.precision(20);

//    freopen("input.txt", "r", stdin);

    bool stress = false;
    if (!stress) {
        int n; cin >> n;
        vector<pt> poly(n);
        for (auto& [x, y] : poly) cin >> y >> x;
        int q; cin >> q;
        vector<pair<int, int>> queries(q);
        for (auto& [c, d] : queries) cin >> c >> d;
        solve(poly, queries);
    } else {
        for (int T = 0;; ++T) {
            cout << "TEST: " << T << endl;
            int n = rand() % 100 + 1;
            vector<pt> poly(n);
            for (auto& [x, y] : poly) {
                x = rand() % 100 + 1;
                y = rand() % 100 + 1;
            }
            int q = rand() % 10 + 1;
            vector<pair<int, int>> queries(q);
            for (auto& [c, d] : queries) {
                c = rand() % 100 + 1;
                d = rand() % 100 + 1;
            }
            solve(poly, queries);
        }
    }
}

