        // Items
        private ComboBox cmbList;
        private Label lblText;
        private Button btnIcon;

        // Events
        public event EventHandler OnSelectedIndexChanged; // Default event

        // Private methods
        private void AdjustComboBoxDimensions()
        {
            cmbList.Width = lblText.Width;
            cmbList.Location = new Point()
            {
                X = this.Width - this.Padding.Right - cmbList.Width,
                Y = lblText.Bottom - cmbList.Height
            };
        }

        // List to store original items for filtering
        private List<string> originalItems = new List<string>();

        #region > Event methods
        // -> Default event
        private void ComboBox_SelectedIndexChanged(object sender, EventArgs e)
        {
            if (OnSelectedIndexChanged != null)
                OnSelectedIndexChanged.Invoke(sender, e);
            // Refresh text
            lblText.Text = cmbList.Text;
        }

        // -> Items actions
        private void Icon_Click(object sender, EventArgs e)
        {
            // Open dropdown list
            cmbList.Select();
            cmbList.DroppedDown = true;
        }

        private void Surface_Click(object sender, EventArgs e)
        {
            // Attach label click to user control click
            this.OnClick(e);
            // Select combo box
            cmbList.Select();
            if (cmbList.DropDownStyle == ComboBoxStyle.DropDownList)
                cmbList.DroppedDown = true; // Open dropdown list
        }

        private void ComboBox_TextChanged(object sender, EventArgs e)
        {
            // Filter items based on text
            string searchTerm = cmbList.Text.ToLower();
            var filteredList = originalItems.Where(item => item.ToLower().Contains(searchTerm)).ToList();

            cmbList.DataSource = filteredList;
            cmbList.DroppedDown = true;
            cmbList.SelectionStart = searchTerm.Length;
            cmbList.SelectionLength = 0;
            cmbList.Cursor = Cursors.Default;
        }
        #endregion

        // -> Draw icon
        private void Icon_Paint(object sender, PaintEventArgs e)
        {
            // Fields
            int iconWidth = 14;
            int iconHeight = 6;
            var rectIcon = new Rectangle((btnIcon.Width - iconWidth) / 2, (btnIcon.Height - iconHeight) / 2, iconWidth, iconHeight);
            Graphics graph = e.Graphics;

            // Draw arrow down icon
            using (GraphicsPath path = new GraphicsPath())
            using (Pen pen = new Pen(iconColor, 2))
            {
                graph.SmoothingMode = SmoothingMode.AntiAlias;
                path.AddLine(rectIcon.X, rectIcon.Y, rectIcon.X + (iconWidth / 2), rectIcon.Bottom);
                path.AddLine(rectIcon.X + (iconWidth / 2), rectIcon.Bottom, rectIcon.Right, rectIcon.Y);
                graph.DrawPath(pen, path);
            }
        }

